query.query:
query {
  sets {
    id
    name
    cardCount {
      total
    }
  }
}

query {
  sets(filters: {name: "Base Set' OR '1'='1"}) {
    id
    name
  }
}

query {
  sets(filters: {name: "<img src='x' onerror='alert(\"html\")'>"}) {
    id
    name
  }
}

query MySets {
  s: sets {
    id
    name
    releaseDate
  }
}

query {
  sets {
    types {
      name
      kind
      description
    }
  }
}
